class Home{constructor(){this.photographer_home=document.querySelector(".photographer_section");this.dataApi=new DataApi("./photographers.json")}async main(){const photographersDataAll=await this.dataApi.getDataAll();photographersDataAll.forEach(dataHome=>{const TemplateHome=new HomeCard(dataHome);this.photographer_home.append(TemplateHome.createHomeCard())})}}const home=new Home;home.main();